function Events() {
  const [events, setEvents] = useState([]);

  useEffect(() => {
    fetch("http://127.0.0.1:8000/get_events/")
      .then((response) => response.json())
      .then((data) => setEvents(data.events));
  }, []);

  return (
    <div>
      {events.map((event) => (
        <Event key={event.id} event={event} />
      ))}
    </div>
  );
}

export default Events;
